Omdat te veel nooit genoeg is! Johnny Knoxville en de jongens zijn weer bezig met jackass 3.5, een compilatie van tientallen afleveringen met allerlei nieuwe beelden van de idioten waar u bang voor bent. Met nooit-eerder-getoonde stunts, streken en domheid, in deze episodische beelden zien we onder andere een zeer persoonlijke ontmoeting tussen Steve-O met een schildpad, Chris Pontius en zijn ongelooflijke houte piemel, een raket-aangedreven reis naar Uranus met Bam Margera, en de succesvolle grap werd uiteindelijk op Johnny Knoxville gedaan.



